function newA(as, ps, ms) {
    return Object.keys(as).inject({}, function(result, i) {
        var a = pt(0, 0);
        var g = 20;       // this universe's G
        Object.keys(as).forEach(function(j) {
            if (i === j) return;
            var d = Math.max(ps[i].distSquared(ps[j]), 10000),
                diff = ps[j].subPt(ps[i]),
                norm = diff.scaleBy(1.0/diff.r());
            a = a.addPt(norm.scaleBy(g * ms[j] / d));
        }, this)
        result[i] = a;
        return result
    }, this);
}

