function updateMs(ms) {
    var result = {};
    this.bodiesDo(function(m) {
        result[m.id] = ms[m.id] ||
            (function(m) {
                var e = m.getExtent();
                var d = (e.x + e.y) * 0.5;
                return d*d*d;
            })(m);
    });
    this.ms.currentValue = result;
    this.ms.sync();
}

