function beMass(m) {
    m["$owner"] = m.owner;
    m.__defineSetter__("owner", function (val) {
        this["$owner"] = val;
        if (this.frpOwner) {
            this.frpOwner.frpSet(val);
        }
        return val;
    });
    m.__defineGetter__("owner", function () {
        return this["$owner"];
    });
    if (!m.__evaluator) {
        var evaluator = new lively.bindings.FRPCore.Evaluator();
        evaluator.syncWithRealTime = true;
        evaluator.installTo(m);
    }
}

